import React, { useState } from "react";

function InputTable3Col(props) {
  return (
    <tbody>
      <tr>
        <td class="dummy-goal-row">
          <input type="text" placeholder="New Goal" class="profile-input profile-input-goal"></input>
        </td>
        <td class="dummy-goal-row">
          <input type="text" placeholder="What has to happen to accomplish it?" class="profile-input profile-input-text"></input>
        </td>
        <td class="dummy-goal-row">
        </td>
      </tr>
    </tbody>
  );
}

export default InputTable3Col;
